import React, { Component } from "react";
import { FaEnvelope } from "react-icons/fa";

class ContactThree extends Component {
  render() {
    const SocialShare = [
      {
        Social: <FaEnvelope size={100} />,
        link: "mailto:ramettaandrewj@gmail.com",
      },
    ];
    return (
      <div className="contact-form--1">
        <div className="container">
          <div className="row">
            <div className="col-lg-12">
              <div className="section-title text-center mb--30 mb_sm--0">
                <span className="subtitle">Want to Connect</span>
                <h2 className="title">Send me a message!</h2>

                <ul className="social-share social-style--2 color-black text-center d-flex justify-content-center   liststyle">
                  {SocialShare.map((val, i) => (
                    <li key={i}>
                      <a
                        target="_blank"
                        rel="noopener noreferrer"
                        href={`${val.link}`}
                      >
                        {val.Social}
                      </a>
                    </li>
                  ))}
                </ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
export default ContactThree;
